import { Fragment } from 'react';
import { Route, Switch } from 'react-router-dom';

import Contacts from './Pages/Contacts';
import Home from './Pages/Home';
import LeadsModule from './Pages/Leads';
import SignIn from './Pages/Signin';
import Signup from './Pages/Signup';
import SignUpContextProvder from './Store/signUpContext';
import { AuthContextProvider } from './Store/AuthStore';


function App() {
  return (
      <Fragment>
        <Switch>
          <Route path="/" exact component={SignIn}/>
          <Route path="/signup">
           <SignUpContextProvder> <Signup/></SignUpContextProvder>
          </Route>
          <AuthContextProvider>
          <Route path="/home" component={Home}/>
          <Route path="/leads" component={LeadsModule}/>
          <Route path="/contacts" component={Contacts}/>
          </AuthContextProvider>
        </Switch>
      </Fragment>
  );
}

export default App;
